import React from 'react';
import './Testimonials.css';

const Testimonials = () => {
  return (
    <section id="testimonials" className="testimonials">
      <h2>Testimonials</h2>
      <p>Include patient reviews and testimonials to build trust and credibility.</p>
    </section>
  );
};

export default Testimonials;
